<!DOCTYPE html>
<html lang="en">
{% load static  %}
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>styling_fetched data</title>
        <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"
        integrity="sha256-p4NxAoJBhIIN+hmNHrzRCf9tD/miZyoHS5obTRR9BMY="
        crossorigin=""/>
        <link rel="stylesheet" href="{% static 'css/leaflet-calendar.css'%}">
        <style>
            #map{
            height: 700px; 
            width:1000px;
            margin:auto;}
        </style>
    </head>
<body>
    <div id="map"></div>
    <form id="dateForm" method="GET" action="{% url 'sf_db_styling' %}">
      <input type="hidden" id="date_to_fetch" name="date_to_fetch" value="25-08-2000">
  </form>
    <table border="1">
        <thead>
            <tr>
                {% for column in columns %}
                    <th>{{ column }}</th>
                {% endfor %}
            </tr>
        </thead>
        <tbody>
            {% for row in rows %}
                <tr>
                    {% for value in row %}
                        <td>{{ value }}</td>
                    {% endfor %}
                </tr>
            {% endfor %}
        </tbody>
    </table> 
    <script> 
        // Embed rows and columns directly into JavaScript variables
        const rows = [
            {% for row in rows %}
                [{% for value in row %}'{{ value|escapejs }}', {% endfor %}],
            {% endfor %}
        ];
        const columns = [
            {% for column in columns %}
                '{{ column|escapejs }}',
            {% endfor %}
        ];
        
    </script>
    
</body>
</html>

<!-- Make sure you put this AFTER Leaflet's CSS -->
<script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"
integrity="sha256-20nQCchB9co0qIjJZRGuk2/Z9VM+kNiyxNV1lvTlZBo="
crossorigin=""></script>

<script src="https://code.jquery.com/jquery-3.6.0.min.js"></script>

<script src="{% static 'js/leaflet-calendar.js' %}"></script> 
<script> 



// Set up the map
var map = L.map('map').setView([22,84], 4);

// Add OpenStreetMap as the base layer
L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
attribution: 'Â© OpenStreetMap contributors'
}).addTo(map);

// Function to determine color based on value
function getColor(value) {
    if (value <= 1) {
        return '#FF0000';
    } else if (value > 1 && value<=10) {
        return '#FFFF00';
    } else {
        return '#0000FF';
    }
}  


var sld=`<?xml version="1.0" encoding="UTF-8"?>
<StyledLayerDescriptor xmlns="http://www.opengis.net/sld" xsi:schemaLocation="http://www.opengis.net/sld http://schemas.opengis.net/sld/1.1.0/StyledLayerDescriptor.xsd" version="1.1.0" xmlns:ogc="http://www.opengis.net/ogc" xmlns:se="http://www.opengis.net/se" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns:xlink="http://www.w3.org/1999/xlink">
  <NamedLayer>
    <se:Name>cis:output</se:Name>
    <UserStyle>
      <se:Name>output</se:Name>
      <se:FeatureTypeStyle>
        `;

for(var i=1; i<columns.length;i++){
    var iD=columns[i];
    var value=rows[0][i];
    var colorDynamic=getColor(value);
    console.log(value);
    var a=`<se:Rule>
            <se:Name>${iD}</se:Name>
            <se:Description>
              <se:Title>${iD}</se:Title>
            </se:Description>
            <ogc:Filter xmlns:ogc="http://www.opengis.net/ogc">
              <ogc:PropertyIsEqualTo>
                <ogc:PropertyName>objectid</ogc:PropertyName>
                <ogc:Literal>${iD}</ogc:Literal>
              </ogc:PropertyIsEqualTo>
            </ogc:Filter>
            <se:PolygonSymbolizer>
              <se:Fill>
                <se:SvgParameter name="fill">${colorDynamic}</se:SvgParameter>
              </se:Fill>
              <se:Stroke>
                <se:SvgParameter name="stroke">#232323</se:SvgParameter>
                <se:SvgParameter name="stroke-width">1</se:SvgParameter>
                <se:SvgParameter name="stroke-linejoin">bevel</se:SvgParameter>
              </se:Stroke>
            </se:PolygonSymbolizer>
          </se:Rule>`;
    sld+=a;

    
   
} 
var c=`</se:FeatureTypeStyle>
</UserStyle>
</NamedLayer>
</StyledLayerDescriptor>`;
sld+=c;

//using calendar
    var  selectDate=L.control.calendar({
      id: 1,
      minDate: "1979-01-01",
      maxDate: "2021-01-01",
      onSelectDate: function(value) {
        var value_formatted;
        // formatDate changes the format of the date
        function formatDate(dateString) {
          // Split the date string into parts
          var parts = dateString.split('-');
          // Rearrange the parts in the desired format
          value_formatted= parts[2] + '-' + parts[1] + '-' + parts[0];
      }
        formatDate(value); //calling function to change date format
        document.getElementById('date_to_fetch').value = value_formatted;
        // Submit the form
        document.getElementById('dateForm').submit();
    },
      position: "topleft",
    });
  
  selectDate.addTo(map);
